import React, { useState, useEffect } from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';

const ItemInfo = () => {
  const [itemData, setItemData] = useState({
    id: '',
    name: '',
    cost: '',
    addTime: '',
  });

  useEffect(() => {
    const fetchData = async () => {
      const url = `http://localhost:8080/api/v1/users/tradeitem`;
      const bearer = 'Bearer ' + localStorage.getItem('token');

      const requestOptions = {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          Authorization: bearer,
        },
      };

      try {
        const response = await fetch(url, requestOptions);
        if (!response.ok) {
          throw new Error('Failed to fetch item data');
        }
        const data = await response.json();
        setItemData({
          id: data.id,
          name: data.name,
          cost: data.cost,
          addTime: data.addTime,
        });
      } catch (error) {
        console.error(error);
      }
    };

    fetchData();
  }, []);

  return (
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>ID</TableCell>
            <TableCell>Name</TableCell>
            <TableCell>Cost</TableCell>
            <TableCell>Add Time</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          <TableRow>
            <TableCell>{itemData.id}</TableCell>
            <TableCell>{itemData.name}</TableCell>
            <TableCell>{itemData.cost}</TableCell>
            <TableCell>{itemData.addTime}</TableCell>
          </TableRow>
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default ItemInfo;
